import React, { Component } from 'react';
import Table from 'react-bootstrap/Table';
import styles from './PowerPlantsData.module.css';


class PowerPlantsData extends Component {


    constructor(props) {
        super(props);
        this.state = {

            items: [],
            isLoaded: true,
            searchString: null
        };
    }
    // Loop through API
    componentDidMount(){
        this.interval = setInterval(() => this.setState({ time: Date.now() + 10 }), 1000);
        this.getFetch();
    }

    componentDidUpdate(){
        clearInterval(this.interval);
    }

    getFetch = () => {

        fetch('http://localhost:8081/power-plants')
            .then(res => res.json())
            .then(json => {
                this.setState({
                    isLoaded: true,
                    items: json
                })

            });
    }

    render () {

        let { items, searchString } = this.state;

            // return(
            //     items.filter((data) => {
            //         if(searchString == null)
            //             return data;
            //         else if(data.type.toLowerCase().includes(searchString.toLowerCase())){
            //             return data;
            //         }
            //       }).map(data => {
                    return(
                        <div className = {styles.PowerPlanet}>
                            <Table>
                                <tbody>
                                    <tr>
                                        <th className = {styles.TableTop}>Federal Network Agency Number</th>
                                        <th className = {styles.TableTop}>Name</th>
                                        <th className = {styles.TableTop}>Company Name</th>
                                        <th className = {styles.TableTop}>Postal Code</th>
                                        <th className = {styles.TableTop}>City</th>
                                        <th className = {styles.TableTop}>Address</th>
                                        <th className = {styles.TableTop}>State</th>
                                        <th className = {styles.TableTop}>Start Date</th>
                                        <th className = {styles.TableTop}>Status</th>
                                        <th className = {styles.TableTop}>Type</th>
                                        <th className = {styles.TableTop}>Net Nominal Power MegaWatt</th>
                                    </tr>
                                </tbody>
                                <tbody>
                                    <tr>
                                        <td className = {styles.TableTop}>{items.bundesnetzagentur_number}</td>
                                        <td className = {styles.TableTop}>{items.name}</td>
                                        <td className = {styles.TableTop}>{items.company_name}</td>
                                        <td className = {styles.TableTop}>{items.plz}</td>
                                        <td className = {styles.TableTop}>{items.city}</td>
                                        <td className = {styles.TableTop}>{items.address}</td>
                                        <td className = {styles.TableTop}>{items.state}</td>
                                        <td className = {styles.TableTop}>{items.start_date}</td>
                                        <td className = {styles.TableTop}>{items.status}</td>
                                        <td className = {styles.TableTop}>{items.type}</td>
                                        <td className = {styles.TableTop}>{items.net_nominal_power_mw}</td>
                                    </tr>          
                                </tbody>
                            </Table>
                        </div>  
                    )
                  }
            //     )
